      SELECT - 18 * col1 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( - col2 * + 96 + + + col2 / - + 32 ) IS NULL;
  - name: tab0

outputs:
  - name: q5830.out
    data: |
      -1458
      -18
      -378
